(function(){var loadHandler=window['sl_{D6ED4975-1042-491C-AA53-2C8DF54D660A}'];loadHandler&&loadHandler(43, '<div id="spr0_95f90a2"><div id="spr1_95f90a2" class="kern slide"><img id="img3_95f90a2" src="data:image/png;base64," width="1280px" height="720px" alt="" style="left:0px;top:0px;"/><div id="spr3_95f90a2" style="left:986.15px;top:662.674px;"><div id="spr4_95f90a2"><img id="img0_95f90a2" src="data:image/png;base64," width="273.75" height="48" alt="" style="left:0.06px;top:-0.065px;"/></div></div></div><div id="spr2_95f90a2" class="kern slide"><div id="svg0_95f90a2" style="left:1105.645px;top:637px;"><svg width="168" height="38" viewBox="0 0 168 38"><path fill="#e2f0d9" d="M0,0 h167.04 v37.44 h-167.04 Z"/></svg></div><div id="spr5_95f90a2" style="left:1105.645px;top:637px;"><div style="width:0px;"><span id="txt0_95f90a2" class="relpos" data-width="74.242188" style="left:9.6px;top:1.933px;">Book B  </span> <span id="txt1_95f90a2" class="relpos" data-width="73.511719" style="left:9.593px;top:1.933px;">Page 30</span></div></div><div id="spr6_95f90a2" style="left:57.882px;top:5.613px;"><div id="spr7_95f90a2" style="left:-100.952px;top:-8.246px;"><img id="img1_95f90a2" src="data:image/png;base64," width="1216.47" height="859.416" alt=""/></div></div><div id="spr8_95f90a2" style="left:721.922px;top:64.036px;"><div id="spr9_95f90a2"><img id="img2_95f90a2" src="data:image/png;base64," width="539.25" height="309.75" alt="" style="left:0.047px;top:-0.077px;"/></div></div><div id="spr10_95f90a2" style="left:48.533px;top:79.344px;"><div style="width:0px;"><span id="txt2_95f90a2" data-width="461.722656" style="left:9.6px;top:3.39px;">Sometimes mistakes occur during meiosis and</span></div><div style="width:0px;"><span id="txt3_95f90a2" data-width="504.001282" style="left:9.6px;top:34.124px;">segregation does not occur normally. This is called</span></div><div style="width:0px;"><span id="txt4_95f90a2" class="relpos" data-width="159.308594" style="left:9.6px;top:64.857px;">nondisjunction</span> <span id="txt5_95f90a2" class="relpos" style="left:9.593px;top:64.857px;">.</span></div><div style="width:0px;"><span id="txt6_95f90a2" class="nokern relpos" dir="auto" style="left:9.6px;top:107.16px;">•</span> <span id="txt7_95f90a2" class="relpos" data-width="129.813141" style="left:31.664px;top:103.59px;">Anaphase I: </span> <span id="txt8_95f90a2" class="relpos" data-width="416.345032" style="left:31.658px;top:103.59px;">both homologous chromosomes move to</span></div><div style="width:0px;"><span id="txt9_95f90a2" data-width="399.533203" style="left:39.6px;top:134.324px;">the same pole (they do NOT segregate).</span></div><div style="width:0px;"><span id="txt10_95f90a2" class="nokern relpos" dir="auto" style="left:9.6px;top:168.626px;">•</span> <span id="txt11_95f90a2" class="relpos" data-width="136.996094" style="left:31.664px;top:165.057px;">Anaphase II: </span> <span id="txt12_95f90a2" class="relpos" data-width="409.527344" style="left:31.658px;top:165.057px;">both sister chromatids move to the same</span></div><div style="width:0px;"><span id="txt13_95f90a2" data-width="48.863930" style="left:39.6px;top:195.79px;">pole.</span></div><div style="width:0px;"><span id="txt14_95f90a2" class="relpos" data-width="344.371735" style="left:9.6px;top:234.524px;">     The abnormal gametes can be: </span> <span id="txt15_95f90a2" class="relpos" data-width="69.756226" style="left:9.593px;top:237.446px;">1n +1 </span> <span id="txt16_95f90a2" class="relpos" data-width="27.370441" style="left:9.587px;top:234.524px;">or </span> <span id="txt17_95f90a2" class="relpos" data-width="63.336956" style="left:9.58px;top:237.446px;">1n ˗1.</span></div></div><div id="spr11_95f90a2" style="left:48.533px;top:396.277px;"><div style="width:0px;"><span id="txt18_95f90a2" class="relpos" data-width="326.541656" style="left:9.6px;top:3.39px;">Nondisjunction can occur to the </span> <span id="txt19_95f90a2" class="relpos" data-width="121.667313" style="left:9.593px;top:3.39px;">autosomes </span> <span id="txt20_95f90a2" class="relpos" data-width="209.921219" style="left:9.587px;top:3.39px;">(pairs 1 to 22) or the </span> <span id="txt21_95f90a2" class="relpos" data-width="34.752602" style="left:9.58px;top:3.39px;">sex</span></div><div style="width:0px;"><span id="txt22_95f90a2" class="relpos" data-width="155.102859" style="left:9.6px;top:34.124px;">chromosomes </span> <span id="txt23_95f90a2" class="relpos" data-width="428.287109" style="left:9.593px;top:34.124px;">(pair 23) that determine an individual’s sex.</span></div><div style="width:0px;"><span id="txt24_95f90a2" data-width="759.466125" style="left:9.6px;top:76.857px;">After fertilization, the resulting zygote will have aneuploidy by having either:</span></div><div style="width:0px;"><span id="txt25_95f90a2" class="nokern relpos" dir="auto" style="left:9.6px;top:119.16px;">•</span> <span id="txt26_95f90a2" class="relpos" data-width="252.753250" style="left:31.664px;top:115.59px;">one extra chromosome - </span> <span id="txt27_95f90a2" class="relpos" data-width="95.691406" style="left:31.658px;top:115.59px;">trisomy (</span> <span id="txt28_95f90a2" class="relpos" data-width="69.756226" style="left:31.651px;top:118.512px;">2n + 1</span> <span id="txt29_95f90a2" class="relpos" style="left:31.645px;top:115.59px;">)</span></div><div style="width:0px;"><span id="txt30_95f90a2" class="nokern relpos" dir="auto" style="left:9.6px;top:149.893px;">•</span> <span id="txt31_95f90a2" class="relpos" data-width="306.686188" style="left:31.664px;top:146.324px;">or one missing chromosome - </span> <span id="txt32_95f90a2" class="relpos" data-width="133.598297" style="left:31.658px;top:146.324px;">monosomy (</span> <span id="txt33_95f90a2" class="relpos" data-width="68.107132" style="left:31.651px;top:149.246px;">2n – 1</span> <span id="txt34_95f90a2" class="relpos" style="left:31.644px;top:146.324px;">)</span> <span id="txt35_95f90a2" class="relpos" style="left:31.638px;top:146.324px;">.</span></div></div><div id="spr12_95f90a2" style="left:48.533px;top:601.439px;"><div style="width:0px;"><span id="txt36_95f90a2" class="relpos" data-width="359.014313" style="left:9.6px;top:3.39px;">Examples of nondisjunction include </span> <span id="txt37_95f90a2" class="relpos" data-width="180.680328" style="left:9.593px;top:3.39px;">Down syndrome </span> <span id="txt38_95f90a2" class="relpos" data-width="134.085281" style="left:9.587px;top:3.39px;">(Trisomy 21), </span> <span id="txt39_95f90a2" class="relpos" data-width="111.064453" style="left:9.58px;top:3.39px;">Klinefelter</span></div><div style="width:0px;"><span id="txt40_95f90a2" class="relpos" data-width="105.818359" style="left:9.6px;top:34.124px;">syndrome</span> <span id="txt41_95f90a2" class="relpos" data-width="109.282547" style="left:9.593px;top:34.124px;"> (XXY) and </span> <span id="txt42_95f90a2" class="relpos" data-width="205.881500" style="left:9.587px;top:34.124px;">Turner’s syndrome </span> <span id="txt43_95f90a2" class="relpos" data-width="55.261066" style="left:9.58px;top:34.124px;">(XO). </span> <span id="txt44_95f90a2" class="relpos" data-width="234.089554" style="left:9.573px;top:34.124px;">You are not required to</span></div><div style="width:0px;"><span id="txt45_95f90a2" data-width="349.503601" style="left:9.6px;top:64.857px;">memorize these genetic conditions.</span></div></div><div id="spr13_95f90a2" style="left:1224.769px;"><div id="svg1_95f90a2" style="left:5.031px;top:4.251px;"><svg width="47" height="28" viewBox="0 0 47 28"><path fill="#c00000" d="M0,0 h46.08 v27.429 h-46.08 Z"/></svg></div><div id="svg2_95f90a2" style="left:0px;top:0px;"><svg width="65" height="28" viewBox="0 0 65 28"><path fill="none" d="M0,0 h64.174 v27.433 h-64.174 Z"/></svg></div><div id="spr14_95f90a2"><div style="width:0px;"><span id="txt46_95f90a2" data-width="42.155083" style="left:9.598px;top:2.268px;">END</span></div></div></div></div></div>', '{"s":[]}');})();